import { useEffect, useState } from 'react'
import './app.css'

function App() {

  const [no1 , setNo1] = new useState(0);
  const ttl = document.getElementById('title').innerHTML;


  return (
    <div className="App ">
      <button
        onClick={() => {
          setNo1(no1 + 1);
        }}
      >
        button 1  - {no1}
      </button>

      <h1> {ttl}</h1>

    </div>
  );
}

export default App;
